import React from 'react';

const Intermission = () => {
  return (
    <div className="ytv pt-3">
      <img
        src="https://devocionmatutina.com/wp-content/uploads/2016/12/Logo_web2.png"
        alt=""
      />
      <div>
        <img
          src="https://www.logolynx.com/images/logolynx/38/38f0597a155a341e2682e9f42a18b922.png"
          alt=""
          width="350"
        />
      </div>
    </div>
  );
};

export default Intermission;
